export default class InstructorSchedule extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		console.log('Prop is ' + this.props.value);

		if (this.props.value === 'Bianca') {
			return (
				<div>
					<Head>
						<title>Yoga Kickstarter</title>
						<link
							rel="stylesheet"
							href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
						/>
					</Head>;
					{this.props.value}'s Schedule
					<div className="box">Monday</div>
					<div className="box">Wednesday</div>
				</div>
			);
		} else if (this.props.value === 'Suffian') {
			return (
				<div>
					<Head>
						<title>Yoga Kickstarter</title>
						<link
							rel="stylesheet"
							href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
						/>
					</Head>;
					<h1>{this.props.value}'s Schedule</h1>
				</div>
			);
		} else {
			return (
				<div>
					<h1>{this.props.value}'s Schedule</h1>
				</div>
			);
		}
